import { useEffect } from "react";

const Home = () => {
  const [sugars, setSugars] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch("http://localhost:5000/api/sugars");
      const data = await response.json();

      if (response.ok) {
        setSugars(data);
      }
    };
    fetchData();
  });

  return (
    <div>
      <h2>SugarSync</h2>
    </div>
  );
};

export default Home;
